import React from 'react';
import "./Tri.css";

function Tri() {

    function tritop(e) {
        e.target.style.background = 'red';
      }

    return (  
        <div>
            <div>
                <div className="d-flex justify-content-center">
                    
                    <img src={require(`./images/bg.png`)} className="triselecter"/>
                </div>
                <div>

                <button onMouseOver={tritop} onMouseLeave={tritopl}>
                    <img src={require(`./images/top.png`)} className="tritop"/>
                </button>

                    <img src={require(`./images/right.png`)} className="triright"/>
                    <img src={require(`./images/left.png`)} className="trileft"/>
                    <img src={require(`./images/bot.png`)} className="tribot"/>
                </div>
            </div>

        </div>
    );

}

export default Tri;
